    <div class="player napad" *ngFor="let igrac of napadaci">
      {{ igrac.ime }}
    </div>
  </div>
  <div class="zamene">
    <!-- Lista zamena -->
    <div class="player substitute" *ngFor="let igrac of igraciZamena">
      {{ igrac.ime }}
    </div>
  </div>
</div>





